import React, { useState } from 'react'
import axios from 'axios'
import logo from '../Images/food.png'
import admin from '../Images/Admin.png'

const Register = () => {
    const [fullName, setFullName] = useState();
    const [userRole, setUserRole] = useState();
    const [email, setEmail] = useState();
    const [password, setPassword] = useState();

    const handleRegister = async (e) =>{
        e.preventDefault(); // ป้องกันการ reload หน้า
        try {
            const response = await axios.post("http://localhost:5293/api/auth/register",{
            email,
            password,
            fullName,
            });
          alert(response.data); // แจ้งสถานะการลงทะเบียน
        } catch (error) {
            alert("Registration failed: " + error.response.data);
        }
    }

    return (
        <div className="login-register-container">
        <div className="logo">
            <img src={logo}/>
        </div>
        <div className="form-container">
            <img src={admin} className="avatar"
            />
            <form onSubmit={handleRegister}>
            <input type='fullname' placeholder='Full Name...' value={fullName} onChange={(e) => setFullName(e.target.value)} required />
            <inpu type='userRole' placeholder='Role...' value={userRole} onChange={(e)=>setUserRole(e.target.value)} required />
            <input type="email" placeholder="Email..." value={email} onChange={(e)=>setEmail(e.target.value)} required />
            <input type="password" placeholder="Password..." value={password} onChange={(e)=>setPassword(e.target.value)} required/>
            <button type="submit" className="btn">
                Register
            </button>
            </form>
        </div>
        </div>
    )
}

export default Register
